import React from 'react';
import './Header.css';
import '../App.css';

function Header() {
  return (
    <>
    <div className="header-container">
        <h1 className="header-workout">
            WORKOUT
        </h1>
        <p className="header-subtitle">
            THE HOME OF GAINS.
        </p>
    </div>
    </>
  )
}

export default Header
